from itertools import islice
def dws(s, t): # returns string s ++ t where s and t are digits strings, len(s) <= len(t)
    return "".join(str(int(c)+int(d)) for c, d in zip(s.zfill(len(t)), t))
def agen(): # generator of terms
    s, t = "1", "1"
